import { useState, useCallback } from "react";
import PortalPopup from "./PortalPopup";
import Mytrip from "./Mytrip";
import "./Navbar.css";

const Navbar = () => {
  const [isUserProfileOpen, setUserProfileOpen] = useState(false);
  const [isMytripOpen, setMytripOpen] = useState(false);

  const openUserProfile = useCallback(() => {
    setUserProfileOpen(true);
  }, []);

  const closeUserProfile = useCallback(() => {
    setUserProfileOpen(false);
  }, []);

  const openMytrip = useCallback(() => {
    setMytripOpen(true);
  }, []);

  const closeMytrip = useCallback(() => {
    setMytripOpen(false);
  }, []);

  return (
    <>
      <div className="navbar">
        <div className="navbar-pic" onClick={openUserProfile}>
          <img className="navbar-pic-icon" alt="" src="/uf-img@2x.png" />
        </div>
        <button className="discover">Discover</button>
        <button className="trips" onClick={openMytrip}>
          Trips
        </button>
        <button className="community">Community</button>
        <button className="my-plan">My Plan</button>
      </div>
      {isUserProfileOpen && (
        <PortalPopup
          overlayColor="rgba(113, 113, 113, 0.3)"
          placement="Centered"
          onOutsideClick={closeUserProfile}
        >
          <Frame onClose={closeUserProfile} />
        </PortalPopup>
      )}
      {isMytripOpen && (
        <PortalPopup
          overlayColor="rgba(113, 113, 113, 0.3)"
          placement="Centered"
          onOutsideClick={closeMytrip}
        >
          <Mytrip onClose={closeMytrip} />
        </PortalPopup>
      )}
    </>
  );
};

export default Navbar;
